import React from 'react';
import { styled } from 'styled-components';

const Img = styled.img `
  width: 300px;
  border: 1px solid #ccc;
`;

const Title = styled.div`
  font-weight: bold
`;

const Product = ({it}) => {
  return (
    <div>
      <Img src={it.img}/>
      <div>{it.title}</div>
      <div>{it.price}</div>
    </div>
  )
}

export default Product;
